商品説明
<table width="700" border="0" cellspacing="0" cellpadding="0">
  <tr>
    <td><font size="-1" face="Meiryo" Color="#1e90ff">レーシングホイールナット 40mm<br>
  アルマイト仕上げ<br>
P1.25 / P1.5（選択） 赤/青/黒/ゴールド/シルバー（5色選択） 20個セット</Font>
    </td>
  </tr>
  <tr>
    <td height="62"><font size="-2" face="Meiryo">鋳造アルミにアルマイト仕上げがツヤ感が抜群！<br>
ホイールナットの軽量化だけではなく、 替えるだけで手軽にドレスアップできます！</font></td>
  </tr>
  <tr>
    <td height="167"><font size="-1" face="Meiryo" Color="#228b22">製品仕様</Font><br>
<font size="-1" face="Meiryo">
素材：アルミ鋳造<br>
座面：60度テーパー<br>
全長：40mm<br>
ボルトサイズ：M12<br>
使用レンチサイズ：19HEX<br>
ピッチ：P1.25 / P1.5（選択）<br>
色：赤/青/黒/ゴールド/シルバー（選択）<br>
表面処理：アルマイト加工</font></td>
  </tr>
  <tr>
    <td height="84"><font size="-1" face="Meiryo" Color="#228b22">【P1.25：適合車種】</Font>　<font size="-1" face="Meiryo">日産　スバル　スズキ</font><br>
<font size="-1" face="Meiryo" Color="#228b22">【P1.5：適合車種】</Font>　<font size="-1" face="Meiryo"> トヨタ　三菱　イスズ　ホンダ　ダイハツ　マツダ<br>
（一部車両は異なりますのでご注意下さい）</font></td>
  </tr>
  <tr>
    <td height="64"><font size="-1" face="Meiryo" Color="#228b22">商品内容</Font><br>
    <font size="-1" face="Meiryo">ナット×20（6角形/貫通ナット）</font></td>
  </tr>
  <tr>
    <td height="82"><font size="-1" face="Meiryo" Color="#FF0000">注意</Font><br>
<font size="-1" face="Meiryo" >・インパクトレンチは破損の原因となりますので使用しないでください。&#160;<br>
・純正スタッドボルトがスペーサーの厚みより長い場合はホイールの裏側に逃げがあるか確認してください。<br>
・一度取り付け,使用された商品は返品できません。注文前に必ず専門知識のある方にサイズ等の確認をお願いいたします。
<br><br>
※商品仕様、パッケージデザインなど予告なく変更する場合がございます。ご了承ください。</font></td>
  </tr>
</table><br><style type="text/css">

