/* カテゴリーリストの表示 */
.subcategory_list {
display:none !important;
}

a.subcategory_list {
background-color: #fff; /* 店舗ごとに任意 */
margin-bottom: 2px; /* 店舗ごとに任意 */
border-radius: 10px; /* 店舗ごとに任意 */
border: 5px solid #93c9fb; /* 店舗ごとに任意 */
display: block !important;
text-decoration: none;
height: 35px; /* 店舗ごとに任意 */
width: 220px; /* 店舗ごとに任意 */
margin-top: 0px; /* 店舗ごとに任意 */
padding-top: 2px; /* 店舗ごとに任意 */
line-height: 30px; /* 店舗ごとに任意 */
text-align: center; /* 店舗ごとに任意 */

/* アニメーションさせたいプロパティを指定しています */
-webkit-transition: border-radius 0.1s ease-out, background-color 0.1s ease-out, font-size 0.1s ease-out, font-weight 0.1s ease-out;
-moz-transition: border-radius 0.1s ease-out, background-color 0.1s ease-out, font-size 0.1s ease-out, font-weight 0.1s ease-out;
-ms-transition: border-radius 0.1s ease-out, background-color 0.1s ease-out, font-size 0.1s ease-out, font-weight 0.1s ease-out;
transition: border-radius 0.1s ease-out, background-color 0.1s ease-out, font-size 0.1s ease-out, font-weight 0.1s ease-out;
}

/* マウスオーバー時のあしらいを設定 */
a.subcategory_list:hover {
background-color: #e9f4fe;
border-radius: 30px;
font-size:85%;
font-weight:bold;
}

/* カテゴリーページの商品リスト諸々 */
html,body {
font-family: メイリオ; /* フォント指定 */
}

/* 商品名部分 */
a.category_itemnamelink {
display:none;
margin-top: -80px;
}

/* 価格部分 */
span.category_itemprice {
display: block;
font-size: 18px;
color: #c00;
margin-top: -50px;
}

span.category_itemtaxpostage {font-size:10px;} /* 送料・税込の非表示 */
table{z-index:0;}

</style>

